import React from 'react';

import PlayerDashboardRenderer from '../renderers/PlayerDashboardRenderer';

type PlayerDashboardContainerProps = {
  playerAbbr: string
}

const PlayerDashboardContainer = ({ playerAbbr: string }: PlayerDashboardContainerProps) => (
  <PlayerDashboardRenderer playerAbbr={playerAbbr} />
)

export default PlayerDashboardContainer;
